За Родину или За Родину! — несколько бронепоездов, построенных в СССР в разные годы и носящих одинаковое наименование:

отдельный броневой поезд «За Родину» Ленинградского фронта, обращён 30 апреля 1942 года на формирование 72-го отдельного дивизиона броневых поездов (72 однбп);
отдельный броневой поезд № 651 или отдельный броневой поезд  «За Родину» (командир — капитан В. К. Корнелюк) 27-го отдельного дивизиона броневых поездов (27 однбп);
отдельный броневой поезд «За Родину» 377-го отдельного зенитно-артиллерийского дивизиона броневых поездов, обращён 28 июня 1943 года на укомплектование 996 зенап;
2-й отдельный броневой поезд «За Родину» 38-й армии, позднее 9-й армий, переименован 6 ноября 1941 года в 10-й отдельный броневой поезд «За Родину»;
6-й отдельный броневой поезд «За Родину», переименован 27 апреля 1942 года в 1-й броневой поезд или «За Родину» 64 однбп;
10-й отдельный броневой поезд «За Родину» Южного фронта, 9-й армий, позднее 12-й армий, переименован 6 ноября 1941 года во 2-й отдельный броневой поезд «За Родину», далее 27 апреля 1942 года переименован во 2-й броневой поезд 64 однбп;
броневой поезд № 2 или «За Родину» (командир — капитан А. Л. Бондаренко) — поддерживал 28-ю  железнодорожную бригаду в ноябре 1941 г.;
бронепоезд № 6 или «За Родину» (командир — капитан П. К. Шурыгин) — поддерживал 28-ю  железнодорожную бригаду в ноябре 1941 г.;
бронепоезд № 11 или «За Родину» (командир — капитан П. М. Бойко) 18-й армии Южного фронта — поддерживал 28-ю  железнодорожную бригаду в  ноябре 1941 г.;
бронепоезд Азовской военной флотилии № 10 или «За Родину», командир старший лейтенант М. Р. Чечельницкий, февраль - 26 июля 1942 г. ( [Бронепоезд Азовской флотилии №10 «За Родину»] ).

«Германия в 1945—1949 годах» или «Оккупация Германии» (неофициальное название этого периода — «нулевые годы») — период существования Германии по окончании Второй мировой войны (1939—1945) в Европе, в течение которого территория Германии была  оккупирована войсками Союза Советских Социалистических Республик, Соединённого Королевства, Соединённых Штатов Америки и Французской Республики и находилась под управлением военных администраций этих союзных государств.
На момент подписания акта о безоговорочной военной капитуляции 8 (9) мая 1945 года в Германии практически отсутствовала экономика, была разрушена инфраструктура, не имелось собственной полноценной администрации.
6 июня 1945 года были опубликованы соглашения четырёх союзных держав о разделении территории Германии на четыре зоны оккупации и о контрольном механизме в стране, в соответствии с которыми верховная власть в Германии в период выполнения ею основных требований безоговорочной капитуляции должны осуществлять советский, британский, американский и французский главнокомандующие, каждый в своей зоне, согласно инструкциям соответствующих правительств:

восточная зона оккупации — советская (под управлением советской военной администрации);
северо-западная зона оккупации — британская;
юго-западная зона оккупации — американская;
западная зона оккупации — французская.Это были годы не только восстановления экономики, но и переосмысления прошлого и формирования нового образа жизни.

Министерство юстиции Российской Федерации (Минюст России) — федеральный орган исполнительной власти, осуществляющий выработку государственной политики (государственное управление) и нормативно-правовое регулирование в сфере юстиции, а также координирующее деятельность в этой сфере иных федеральных органов исполнительной власти.


== Функции ==
Согласно Указу Президента Российской Федерации от 13 октября 2004 года № 1313 (в редакции от 23 апреля 2017 года) и в соответствии с иными нормативно-правовыми актами, Министерство юстиции Российской Федерации занимается выработкой и реализацией государственной политики и нормативно-правовым регулированием, а также осуществляет правоприменительные функции и функции по контролю и надзору в сферах:

исполнения уголовных наказаний;
регистрации некоммерческих организаций, включая отделения международных организаций и иностранных некоммерческих неправительственных организаций, политические партии, иные общественные объединения и религиозные организации, а также предоставления информации о них;
адвокатуры и адвокатской деятельности;
нотариата и нотариальной деятельности;
государственной регистрации актов гражданского состояния;
легализации и апостиля;
обеспечения установленного порядка деятельности судов и исполнения судебных актов и актов других органов;
оказания бесплатной юридической помощи и правового просвещения населения;
противодействия коррупции и антикоррупционной экспертизы;
деятельности по возврату просроченной задолженности физических лиц, деятельности коллекторов;
территориального устройства РФ;
организации местного самоуправления;
разграничения полномочий между органами власти (государственными, субъектов федерации и местного самоуправления);
правоприменения, надзора и контроля — в установленных случаях.


== История ==


=== XIX век ===
Министерство юстиции Российской империи было учреждено 8 сентября 1802 года Манифестом Александра I «Об учреждении министерств».
